import React, { Component } from 'react';
import Axios from "axios";
import "./App.css";

class Week extends Component {
    constructor(props) {
        super(props)
        this.state = {
            weekDays: ["SUN","MON","TUE","WED","THURS","FRI","SAT"],
            data: [],
        }
    }
    
    render() {
        return (
            <div>
                Week
            </div>
        )
    }
}

export default Week
